=head1 DESCRIPTION

Contains details produced as a result of performing known fraudster
risk analysis on a speaker.

=head1 ATTRIBUTES


=head2 GeneratedFraudsterId => Str

The identifier of the fraudster that is the closest match to the
speaker. If there are no fraudsters registered in a given domain, or if
there are no fraudsters with a non-zero RiskScore, this value is
C<null>.


=head2 B<REQUIRED> RiskScore => Int

The score indicating the likelihood the speaker is a known fraudster.



